import axios from "axios";

const baseURL = "http://localhost:21309/api/";

export default function (product) {
  debugger;
  axios
    .get(`${baseURL}ShoppingCart/Login${shoppingCart.idUser}`)
    .then(function (response) {
      shoppingCart.idUser = response.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
}

function GetShopping() {
  axios
    .get(`${baseURL}ShoppingCart/GetShopping${localStorage.getItem("IdUser")}`)
    .then(function (response) {
      console.log("ShoppingCart/GetShopping");
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
}
